import React from 'react';
import s from "./Review.module.css"

const Review = ({reviews}) => {
    console.log(reviews)
    return (
        <div className={s.review}>
            <div className={s.stop_block}>
                <h2>{reviews.user.name}</h2>

            </div>
        </div>
    );
};

export default Review;
